import React, { useState, useEffect, Component } from 'react';
import ReactDOM from 'react-dom/client';
import { useNavigate } from 'react-router-dom';
import { Link } from 'react-router-dom';
import { Helmet } from "react-helmet";
import './RestaurantManagement.css';
import axios from 'axios';
import { response } from 'express';

const RestaurantManagement = (event) => {

    const [error, setError] = useState(null);
    const getUserName = localStorage.getItem("restUserName");
    const [currentRestaurantName, setCurrentRestaurantName] = useState(null);
    const [currentRestaurantEmail, setCurrentRestaurantEmail] = useState(null);

    const [countries, setCountries] = useState([]);
    useEffect(() => {
        fetch('http//localhost:3000/getResName',
        {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(
            {
                username: getUserName
            })


        })
        .then(response = () => response.json())
        .catch(error => console.error(error))
    });
    return (
        <><><Helmet>
            <title>Restaurant Management Profile Page</title>
        </Helmet>
            <h1>List of Countries</h1>
            <div>
                <ul>
                    {countries.map(c => <li key={c}>{c}</li>)}
                </ul>
            </div>
        </>
            //title
            <div class="content">
                <h1>CaseBites</h1><h2>Username: {getUserName}</h2>
                //replace this with restaurant name
                <h3>Total react packages: {currentRestaurantName}</h3>
            </div><div className="card-body">
            </div>
            //navbar
            <nav>
                <div class="sidebar">
                    <li><a href="#"> Dashboard </a></li>
                    <li><a href="#"> View Feedback </a></li>
                    <li><a href="#"> Reviews </a></li>
                    <li><a href="#"> View/Edit Menu </a></li>
                    <li><a href="#"> Working Hours </a></li>
                    <li><a href="#"> Settings </a></li>
                </div>
                <div class="order">
                    <p>Pickup order time</p><p>
                    </p><p>Working Hours</p><p>
                    </p><p>Pop Items</p><p>
                    </p><p>Wait time</p>
                    <p>Pay options</p>
                </div>

                <div class="ss">
                    <p> Contact information</p>
                    <p> Phone Number: </p>
                    <p> Email Address: {currentRestaurantEmail}</p>

                </div>

                <div class="public-profile">
                    <p> Public profile </p>
                    <p> View public profile </p>
                </div>

                <div class="terms">
                    <p> Terms and agreements </p>
                    <a href="https://www.w3schools.com/">View terms and agreements</a>
                    <p id="demo"></p>

                </div>
            </nav></>



    );
}

export default RestaurantManagement;
